      alert("We recommend to keep two factor active!")
      $("#save_detailes").trigger('click');
      window.location.reload(true);
      } else {
        alert("You will get a one time code in your email each time you trying to login")
      $("#save_detailes").trigger('click');
      window.location.reload(true);

      }
    });
  });
